import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Footer from "./layouts/admin/Footer";
import MasterLayout from "./layouts/admin/MasterLayout";

function App() {
  return (
    <BrowserRouter>
      <MasterLayout>
        <Routes>
          <Route path="/about" element={<Footer />}></Route>
        </Routes>
        </MasterLayout>
    </BrowserRouter>
  );
}

export default App;
